  width: 100vw;
  .flex;
  .justify-center;
  .text-sdark;
  .text-2xl;
  .mt-8;
  .text-center;
  font-weight: 700;

`;

const IconContainer = styled.div`
  .flex;
  .w-full;
  .justify-center;
  .flex-wrap;
  .mt-6;
  .pb-8;
`;

const Icon = styled.img`
  .mx-4;
  .my-1;
`;

