  return (
    <>
      <Intro>Get in Touch</Intro>
      <IconContainer>
          {
              Object.keys(socials).map((key) => {
                  return (<a href={socials[key]} target="_blank"><Icon src={`/social/${key}.svg`} alt={`Vilva's ${key} Account`} /></a>)
              })
          }
